def cheack_page_type(page):
    page_types = {
        "page_id": int,
        "title": str,
        "tag": str,
        "text": str,
        "location_name": str,
        "image": str,
        "good": int,
        "go": int,
        "went": int
    }

    for page_type in page_types:
        assert type(page[page_type]) is page_types[page_type]
    
    assert type(page["location"]["x"]) is float

def test_get_pages():
    tag = "kankou"
    pageNum = 0
    response = client.get(
        url="/pages",
        params={"tag": "kankou", "pageNum": pageNum})
    assert response.status_code == 200
    for page in response.json()["result"]:
        cheack_page_type(page)
        assert page["tag"] == tag
    
