def test_del_page():
    # 最大投稿数の確認
    response = client.get(
        url="/pages",
        params={"tag": "kankou", "pageNum": 0},
    )
    page_num = 0
    tags = ["kankou", "gurume", "tamasanpo", "omiyage"]
    for tag in tags:
        page_num += response.json()["max"][tag]
    if page_num == 0:
        return
    # 最後に投稿された内容を削除する
    response = client.delete(
        url=f"/page/{str(page_num)}"
    )
    assert response.status_code == 200

def test_map():
    # 距離
    response = client.get(
        url="/map",
        params={"myx": 120.4, "myy": 130.3, "request": "nearby"}
    )
    assert response.status_code == 200
    assert len(response.json()) == 3

    # 市区町村名
    response = client.get(
        url="/map",
        params={"myx": 120.4, "myy": 130.3, "request": "district"}
    )
    assert response.status_code == 200
    districts = ["稲城", "八王子", "東大和", "西東京"]
    assert response.json()["district_list"] == districts

def test_regist_and_login():    
    # regist
    response = client.post(
        url="/regist",
        json=account,
    )
    assert response.status_code == 200
    new_token = response.json()["token"]

    # login
    response = client.post(
        url="/login",
        json=account
    )
    assert response.status_code == 200
    if(new_token != "exist name"):
        assert response.json()["token"] == new_token

def test_add_and_delete_point():
    for status in ["good", "went", "go"]:
        # add
        response = client.post(
            url="/point?page_id=7&status=go",
            params={"page_id": 1, "status": status},
            headers={"token": token}
        )
        assert response.status_code == 200
        response = client.get(url="/page/1")
        assert response.json()[status] == 1

        # delete
        response = client.put(
            url="/point",
            params={"page_id": 1, "status": status},
            headers={"token": token}
        )
        assert response.status_code == 200
        response = client.get(url="/page/1")
        assert response.json()[status] == 0

